var jmData=""
var app = new Vue({
  el: '#app',
  data: {
      idx: -1,
      allSocre: 0,
      isshow: false,
      answerShow: false,
      ifanswer: true,
      iftishi1: true,
      iftishi2: false,
      iftishi3: false,
      iftishi4: false,
      ifquestion: false,
      leftS: 5,
      minutes: 25,
      seconds: 0,
      myAnswer: [],
      mbtidata: [],
      questions: [],
      yidaData: {
          idx: 0,
          yida: '',
          data: [],
          myAnswer:[],
          myResult:{"E":0,"I":0, "S":0, "N":0, "T":0, "F":0, "J":0, "P":0}
      },
      local: {
          get: function (key) {
              var val = window.localStorage.getItem(key);
              if (val == null) {
                  return false;
              }
              return JSON.parse(val);
          },
          set: function (key, val) {
              window.localStorage.setItem(key, JSON.stringify(val));
              return true;
          },
          del: function (key) {
              window.localStorage.removeItem(key);
              return true;
          }
      },
      answerAgain:true,
      timeout: false,
      ifleft:false,
      ifright:false,
  timefast:false,
 // myresult:["E":0,"I":0, "S":0, "N":0, "T":0, "F":0, "J":0, "P":0]
  },
  methods: {

      num(n) {
          return n < 10 ? "0" + n : "" + n
      },
      next() {
          this.idx++
          this.ifanswer = true
      },

      tishi1(){
          this.iftishi1 = false
          this.iftishi2 = true
      },
      tishi2(){
          this.iftishi2 = false
          this.iftishi3 = true
      },
      tishi3(){
          this.iftishi3 = false
          this.iftishi4 = true
      },
      test() {
          this.iftishi4 = false
          this.idx = 0
          this.add()
      },
  //判断时间
      iftimefast(){
        //限制时间
        let limitTime = 3*60
        //总时间
        let TotalTime = 25*60
        let nowTime = 60 * this.minutes +  this.seconds
        if( TotalTime - nowTime < limitTime){
            this.timefast = true
            setTimeout(()=>{
              this.afresh2()
            },2000)
        }else{
            window.location.href = 'submit.html'
        }
      },

      //点击选项
      handleCilck(info,theid) {
         
          let option = this.questions[this.idx].option //每一题题目的选项

          if (!this.ifanswer) return
          this.ifanswer = false

          //选中添加样式
          option.forEach(item => {
              if (item.id == info.id) {
                  //如果选中的与数据里面的相等就改变他的样式
                  item.checked = true
              } else {
                  //其他的都为false
                  item.checked = false
              }
          });

          let isAnswer = info.letter //选中的答案
          


          setTimeout(
              () => {
                  this.next()
                  this.yidaData.idx = this.idx
                  this.yidaData.minutes = this.minutes
                  this.yidaData.seconds = this.seconds
                  this.yidaData.yida += isAnswer
                   //统计每个类型的分数
                  this.yidaData.myResult[isAnswer]=this.yidaData.myResult[isAnswer]+1

                //  this.yidaData.data = this.questions
                  this.local.set('gkabc-mbti-data', this.yidaData)

                  if (this.idx == '86') {
                      
                      this.iftimefast()

                  }
              }
              , 200)
      },

      //上一题
      lastAnswer(){

        if (this.idx == 0) {
            return
        }
        this.idx--
        let num = this.yidaData.yida

        this.yidaData.yida = num.slice(0,num.length - 1)
        this.yidaData.idx = this.idx
        // console.log(this.idx);


        //统计每个类型的分数
        this.yidaData.myResult[num.slice(num.length - 1)]=this.yidaData.myResult[num.slice(num.length - 1)]-1



        this.local.set('gkabc-mbti-data', this.yidaData)
    },

      // 倒计时
      add() {
          let time = window.setInterval(() => {
              if (this.seconds == '00' && this.minutes != '00') {
                  this.seconds = 59;
                  this.minutes -= 1;
              } else if (this.minutes == '00' && this.seconds == '00') {
                  this.seconds = 0;
                  window.clearInterval(time);
                  this.idx = -1
                  this.timeout = true

                    let num = this.yidaData.yida.length
                    let addZnum = 86 - num

                    for (let i = 0; i < addZnum; i++) {
                        this.yidaData.yida += 'Y'
                    }
                    this.local.set('gkabc-mbti-data', this.yidaData)
           
                  setTimeout(() => { window.location.href = 'submit.html' }, 3000);
              } else {
                  this.seconds -= 1
              }
          }, 1000);
      },

      //判断是否已答
      ifyd() {
        let homedata = this.local.get('mbti-homedata')
        if (!homedata) {
          window.location.href = './index.html'
        }


          if (this.local.get('gkabc-mbti-data')) {
              this.yidaData = this.local.get('gkabc-mbti-data')
              this.iftishi1 = false
              this.idx = this.yidaData.idx
             // this.questions = this.yidaData.data
              this.myAnswer = this.yidaData.myAnswer
              
          }else{
            this.answerAgain = false
          }


          
          if (this.yidaData && this.yidaData.idx != 0 && this.yidaData.idx != this.questions.length) {
              console.log('继续之前的答题')

              this.idx = this.yidaData.idx
              this.minutes = this.yidaData.minutes
              this.seconds = this.yidaData.seconds

          }
      },

      ifcontinue(){
        if (this.yidaData.idx == this.questions.length) {
          window.location.href = './submit.html'
        }
        this.answerAgain = false
        this.ifquestion = true
        this.add()
      },
      afresh(){
        //设置cookie
        function setCookie(cname, cvalue, exdays) {
            var d = new Date();
            d.setTime(d.getTime() + (exdays*24*60*60*1000));
            var expires = "expires="+d.toUTCString();
            document.cookie = cname + "=" + cvalue + "; " + expires;
        }

        // 删除cookie
        function clearCookie(name) {
            setCookie(name, "", -1);
        }
        clearCookie("ck-mbti-username")
        this.local.del("gkabc-mbti-data")
        window.location.href = './mbtics.html'
      },
      afresh2(){
        //设置cookie
      function setCookie(cname, cvalue, exdays) {
        var d = new Date();
        d.setTime(d.getTime() + (exdays*24*60*60*1000));
        var expires = "expires="+d.toUTCString();
        document.cookie = cname + "=" + cvalue + "; " + expires;
      }

      // 删除cookie
      function clearCookie(name) {
        setCookie(name, "", -1);
      }
      clearCookie("ck-mbti-username")
        this.local.del("gkabc-mbti-data")
        window.location.href = 'mbti.html'
      },

    iftanchang(data){
        if(data == 1){
          this.ifleft = !this.ifleft
          if (this.ifleft) {
            this.$refs.pcnav.style.display = 'block';
            this.$refs.zhezhao.style.display = 'block';
          }else{
            this.$refs.pcnav.style.display = 'none';
            this.$refs.zhezhao.style.display = 'none';
          }
        }else{
          this.ifright = !this.ifright
          if (this.ifright) {
            this.$refs.pcsm.style.display = 'block';
            this.$refs.zhezhao.style.display = 'block';
          }else{
            this.$refs.pcsm.style.display = 'none';
            this.$refs.zhezhao.style.display = 'none';
          }
        }


      },
      myclose(){
        this.$refs.pcnav.style.display = 'none';
        this.$refs.pcsm.style.display = 'none';
        this.$refs.zhezhao.style.display = 'none';
      }
  },
  computed: {
      second() {
          return this.num(this.seconds)
      },
      minute() {
          return this.num(this.minutes)
      }
  },
  watch: {
      second: {
          handler(newVal) {
              this.num(newVal)
          }
      },
      minute: {
          handler(newVal) {
              this.num(newVal)
          }
      }
  },

  beforeMount() {
    // this.questions = this.mbtidata
    var bytes  = CryptoJS.AES.decrypt(jmData, 'secret key 123');
      this.questions = JSON.parse(bytes.toString(CryptoJS.enc.Utf8));
      
  },
  mounted() {
      this.ifyd()
      //设置cookie
    function setCookie(cname, cvalue, exdays) {
      var d = new Date();
      d.setTime(d.getTime() + (exdays * 24 * 60 * 60 * 1000));
      var expires = "expires=" + d.toUTCString();
      document.cookie = cname + "=" + cvalue + "; " + expires;
    }
    // 删除cookie
    function clearCookie(name) {
      setCookie(name, "", -1);
    }
    clearCookie("ck-mbti-username")

  }
})
